commit_message:
FELIX-4421 - Upgrade to Jetty 8: - bumped the embedded Jetty version to latest Jetty 8 version;
- bumped minor versions of all bundles to indicate that this
  version no longer is compatible with Java 5;
- added simple integration test to verify the basic functionality
  provided by the HTTP service.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1565705 13f79535-47bb-0310-9956-ffa450edef68

FELIX-4310, FELIX-4282 - mixed Jetty versions: - the cometd project referenced an older version of Jetty (7.6.3),
  which is not directly incorrect, but not inline with the other
  projects;
- due to this, classes of two different Jetty versions were inlined
  in the http.bundle project, causing subtle errors at runtime;
- upgraded Cometd to 2.7.0 as Cometd 2.4.2 uses Jetty 7.6.3 as
  compile-time dependency, while the 2.7.0 uses Jetty 7.6.13;
- reverted changes for Jetty 9 to make use of latest Jetty 7.6.13
  version (for fix-release);
- updated POMs to use version-properties for most of the used
  libraries. Also downgraded the version numbers in preparation for
  a fix-release.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1540479 13f79535-47bb-0310-9956-ffa450edef68

FELIX-4279, FELIX-4280: - ensure the org.osgi.service.useradmin package is exported by our
  implementation as well;
- ensure the correct import dependencies are used, without hard
  dependencies on other optional services (such as EventAdmin);
- stripped the itests from all redundant bundles to verify this.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1531234 13f79535-47bb-0310-9956-ffa450edef68

Upgraded to Jetty 9.0.5: - this makes this bundle no longer runnable on Java 6 and below;
- Jetty 9 no longer explicitly needs to be configured to use NIO,
  this is handled internally in Jetty;
- still needs some additional TLC to see where we can improve the
  implementation to use the latest features of Jetty.



